CREATE DEFINER=`root`@`localhost` PROCEDURE `setFranchiseCommissionBalance`(
in fId INT, 
IN addBalance double,
out status1 boolean
)
BEGIN

declare oldBalance double;
declare newBalance double;
declare updatedBalance double;

select balance into oldBalance from user where id = fId;

set newBalance = oldBalance + addBalance;

update user set balance = newBalance where id = fId;

select balance into updatedBalance from user where id = fId;

if (updatedBalance > oldBalance) then
	set status1 = true;
else
	set status1 = false;
end if; 

END ;;
