CREATE DEFINER=`root`@`localhost` PROCEDURE `setOfferedHot`(
in productId int(18),
in attribute varchar(10)
)
BEGIN

	if (attribute = 'offered') then
    
		if exists(select * from hot_offered where product_id = productId) then
        
			update hot_offered set offered = 'Y' where product_id = productId;
            
		else 
        
			insert into hot_offered (product_id, offered, hot)
            values (productId, 'Y', 'N');
        
        end if;
    
    end if;


	if (attribute = 'hot') then
    
		if exists(select * from hot_offered where product_id = productId) then
        
			update hot_offered set hot = 'Y' where product_id = productId;
            
		else 
        
			insert into hot_offered (product_id, offered, hot)
            values (productId, 'N', 'Y');
        
        end if;
    
    end if;


END ;;
